insert  into `catalog_product_entity_text`(`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (113,4,72,0,12,'<p>It includes the QuickBooks online Essentials with full featured functionality packaged exclusively in addition to the features bundled up in the Simple Start and Plus both. No software installation is required. Setting up and getting started is prompt and easy. Save quick minutes in paying bills by doing batch payments to the same vendor. Avoid getting cornered to the 11th hour by letting bills automatically processed on recurring schedule and create quick invoices. Seamlessly collaborate with your accountant to make tax time a snap. Receive Free US based Intuit support, automatic backups, and 60-day money-back guarantee as part of complementary takeaways.</p>\r\n<p><strong>Exclusive to QuickBooks online essentials 2017 with Payroll</strong></p>\r\n<ul>\r\n<li>Track inventory</li>\r\n<li>Create and send purchase orders</li>\r\n<li>Prepare and print 1099s</li>\r\n<li>Track billable hours by customer</li>\r\n<li>Create budgets to estimate future income and expenses</li>\r\n<li>Categorize your income and expenses using class tracking</li>\r\n<li>Track sales and profitability for each of your locations</li>\r\n<li>QBO Essentials includes access for 3 users and 2 accountants.</li>\r\n<li>Give employees and subcontractors limited access to enter time worked</li>\r\n<li>65+ insightful in-built business reports to understand the health of your business. </li>\r\n<li>1 year subscription to QuickBooks Online Essentials and Payroll (includes 1 employee - easily add more (nominal fees apply).</li>\r\n</ul>\r\n<p><strong>Catch a glimpse of the other important features:</strong></p>\r\n<ul>\r\n<li>Manage and pay bills from vendors</li>\r\n<li>Enter bills and schedule payments for later</li>\r\n<li>Control what your users can access</li>\r\n<li>Track your income and expenses</li>\r\n<li>Send unlimited estimates and invoices</li>\r\n<li>Print checks and record transactions</li>\r\n<li>Import data from Excel or QuickBooks desktop</li>\r\n<li>Back up your data online automatically</li>\r\n<li>Same security and encryption as banks</li>\r\n<li>Access your data from a tablet or Smartphone.</li>\r\n<li>Invite up to two accountants to access your data</li>\r\n<li>Integrate with available applications</li>\r\n<li>Integrate with QuickBooks Point of Sale</li>\r\n<li>Compare your sales and profitability with industry trends</li>\r\n<li>Set up invoices to automatically bill on a recurring schedule</li>\r\n<li>Download transactions from your bank and credit card accounts</li>\r\n</ul>'),(114,4,73,0,12,'QuickBooks online essentials'),(115,4,83,0,12,NULL),(116,4,106,0,12,NULL),(117,4,72,0,13,'<p>It includes the QuickBooks online plus that exclusively encapsulate legions of features in addition to the ones packed in the Simple Start. No software installation is required. Setting up and getting started is prompt and easy. Instantly prepare 1099s and file your tax returns on time. Track your inventory and make better decisions on purchase. Seamlessly collaborate with your accountant to make tax time a snap. Expand your QuickBooks functionality by easily syncing with 350+ apps. Receive free US based Intuit support, automatic backups, and 60-day money-back guarantee as complementary takeaways.</p>\r\n<p><strong>Exclusive to QuickBooks online plus 2017</strong></p>\r\n<ul>\r\n<li>Track your income and expenses</li>\r\n<li>Send unlimited estimates and invoices</li>\r\n<li>Print checks and record transactions</li>\r\n<li>Import data from Excel or QuickBooks desktop.</li>\r\n<li>Back up your data online automatically</li>\r\n<li>Same security and encryption as banks</li>\r\n<li>Access your data from a tablet or Smartphone.</li>\r\n<li>3 users can access QuickBooks online</li>\r\n<li>Download transactions from your bank and credit card accounts</li>\r\n<li>40+ insightful in-built business reports to understand the health of your business. </li>\r\n</ul>\r\n<p><strong>Catch a glimpse of the other important features:</strong></p>\r\n<ul>\r\n<li>Manage and pay bills from vendors</li>\r\n<li>Enter bills and schedule payments for later</li>\r\n<li>Control what your users can access</li>\r\n<li>Compare your sales and profitability with industry trends</li>\r\n<li>Set up invoices to automatically bill on a recurring schedule</li>\r\n</ul>'),(118,4,73,0,13,'QuickBooks online plus'),(119,4,83,0,13,NULL),(120,4,106,0,13,NULL),(121,4,72,0,14,'<p>It includes the QuickBooks Online Simple Start digital software carrying legions of functionalities. Setup and getting started is prompt and easy. A big relief since no installation is required. Leverage the power of internet by accessing your business data anytime, anywhere, and at any device. Download all transactions from your bank and credit card accounts and get rid of those frustrating manual data entry errors. Creating professional invoices is now just a matter of few clicks. What’s more, now get paid fast by sending invoices online. Seamlessly collaborate with your accountant to make your tax filings effortless and quick. Expand your QuickBooks functionality by easily syncing with 350+ apps. Free US based Intuit support, automatic backup and 60-day money-back guarantee as complementary takeaways.</p>\r\n<p><strong>Smart features of Simple Start:</strong></p>\r\n<ul>\r\n<li>Track your income and expenses</li>\r\n<li>Send unlimited estimates and invoices</li>\r\n<li>Print checks and record transactions</li>\r\n<li>Import data from Excel or QuickBooks desktop</li>\r\n<li>Back up your data online automatically</li>\r\n<li>Same security and encryption as banks</li>\r\n<li>Access your data from a tablet or Smartphone.</li>\r\n<li>Invite up to two accountants to access your data</li>\r\n<li>1 user can access QuickBooks online</li>\r\n<li>Integrate with available applications</li>\r\n<li>Integrate with QuickBooks Point of Sale</li>\r\n<li>Download transactions from your bank and credit card accounts</li>\r\n<li>20+ insightful in-built business reports to understand the health of your business. </li>\r\n</ul>'),(122,4,73,0,14,'QuickBooks online simple start'),(123,4,83,0,14,NULL),(124,4,106,0,14,NULL),(127,4,72,0,15,'<p>It includes QuickBooks Premiere 2017, tailor-made to your industry and bundled with all features packed inside Pro and Plus, it boasts of industry specific features as well(not limited to General Business, Contractor, Manufacturing & Wholesale, Non-Profit, Professional Services, and  Retail). With all new Bill Tracker, now track your bill status at real-time, set and locate reminders from a single window, email invoices to your customers, and get paid fast by letting them pay you via credit card or bank transfer. Organize all in one place by creating and customizing estimates, invoices, and statements, by managing vendors and expenses easily, by getting complete reports at tax –time and finally downloading your online banking transactions directly into QuickBooks. 60-day money-back guarantee.</p>\r\n<p><strong>What’s new:</strong></p>\r\n<ul>\r\n<li>With <strong>Bill Tracker</strong>, track your bill status at Real-Time and eliminate needs to gather data or run reports.</li>\r\n</ul>\r\n<p><strong>What’s enhanced:</strong></p>\r\n<ul>\r\n<li>Declutter “Send forms” queue and manage forms in just single step.</li>\r\n<li>Advanced Reporting now features “this year to last month” filter.</li>\r\n</ul>\r\n<p><strong>Catch a glimpse of other important features:</strong></p>\r\n<ul>\r\n<li>Create and print deposit slips</li>\r\n<li>Document and track change orders.</li>\r\n<li>Run \'Cost to Complete Job\' report.</li>\r\n<li>Bill clients progressively by job phase.</li>\r\n<li>Find all reminders and notifications in one single window.</li>\r\n<li>View customized sales and profitability reports</li>\r\n<li>Track and follow up on sales leads in the Lead Center</li>\r\n<li>Attach and store documents in the Document Center</li>\r\n<li>Create professional looking invoices and forms</li>\r\n<li>Track sales, sales taxes, and customer payments</li>\r\n<li>Easily print checks, pay bills, and track expenses</li>\r\n<li>Complete everyday tasks faster with simplified customer forms</li>\r\n<li>Do more with add-on applications and services available in QuickBooks</li>\r\n<li>View and pin important notes about customers, vendors, and employees</li>\r\n<li>Easier access to data and transactions with simplified navigation</li>\r\n<li>Invoice multiple customers for time and expenses in one batch</li>\r\n<li>See your invoices, billing, and other important tasks in a Calendar View</li>\r\n<li>View shipping rates, print labels, and track packages through UPS, FedEx or USPS</li>\r\n<li>With income tracker, see all your income-producing transactions in one spot.</li>\r\n<li>Keep Customer, Vendor and Employee contact information at your finger tips</li>\r\n<li>Access your inventory items all in one place with the Inventory Center</li>\r\n<li>Track inventory, set reorder points, and create purchase orders</li>\r\n<li>Get a real-time view of your business with Company Snapshot</li>\r\n<li>Get insights to make better business decisions with the Report Center</li>\r\n<li>Import your contacts from Excel or other email address books</li>\r\n<li>Allow up to 5 users to work in QuickBooks at the same time</li>\r\n<li>Set individual user permissions to control access to sensitive information</li>\r\n<li>Create a copy of your company file for your accountant</li>\r\n<li>Import data from Excel, Quicken, and prior QuickBooks versions</li>\r\n<li>Download bank and credit card transactions directly into QuickBooks</li>\r\n<li>Track your balance sheet by class such as a location, department, or profit center</li>\r\n<li>Track time and expenses by employee, project, client, or service.</li>\r\n<li>Set up Memorized Transactions for recurring billing, invoices, and estimates</li>\r\n<li>Save your worksheet formatting when you export QuickBooks reports to Excel</li>\r\n<li>See all your key customer information at a glance with the Customer Snapshot</li>\r\n<li>Access industry-specific report templates created by other QuickBooks Premier users</li>\r\n<li>Send invoices and estimates right from your business Yahoo!, Gmail, or Hotmail account</li>\r\n<li>Easily save a copy of your company file on a shared folder directly from QuickBooks Premier.</li>\r\n<li>Track bounced checks; see key reports in just one click, and other improvements your customers asked for.</li>\r\n<li>Get a complete overview of your business performance instantly on the new Homepage insights.</li>\r\n<li>Get your multiple bank accounts synchronized to pull in all your banking transactions and categorize them for tax-time.</li>\r\n<li>Add multiple attachments, customize email templates and see prior email conversations with powerful email capabilities.</li>\r\n</ul>'),(128,4,73,0,15,'QuickBooks premier'),(129,4,83,0,15,NULL),(130,4,106,0,15,NULL),(131,4,72,0,16,'<p><strong>Product Overview:</strong></p>\r\n<p>A cash drawer that features an all sturdy steel case construction stores cash with security that’s hard to break in. Dual media input slots available that is testament to an improvised design and additional slots to connect with a receipt printer.</p>\r\n<p>Features list:</p>\r\n<ul>\r\n<li>constructed with a sturdy all-steel case</li>\r\n<li>Beefs up security with a lockable feature</li>\r\n<li>Improvised design with dual media input slots</li>\r\n<li>Connects to a receipt printer</li>\r\n</ul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Drawer Dimensions</strong></td>\r\n     <td>16.2\"W x 16.4\"L x 4.3\"H</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Connection Type</strong></td>\r\n    <td>Connects to Receipt Printer</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Money Trail Details</strong></td>\r\n    <td>Removable ABS Plastic, Adjustable 5 Bill / Removeable 8 Coin Compartments, Plastic Bill Weights</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Media Slot Details</strong></td>\r\n    <td>2</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Lock Details</strong></td>\r\n    <td>Three Function Center-Key Lock (manual release, electronic release, and drawer lock)</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Features</strong></td>\r\n    <td>Steel Construction with Painted Drawer Front, Media Storage Area Under Coin Section</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Warranty</strong></td>\r\n    <td>2 Year Factory Warranty<br>\r\nIntuit@s one year rapid replacement warranty</td>\r\n  </tr>\r\n</table>'),(132,4,73,0,16,'cash drawer'),(133,4,83,0,16,NULL),(134,4,106,0,16,NULL),(135,4,72,0,17,'<p><strong>Product Overview:</strong></p>\r\n<p>Simple yet sophisticated to help ring up your sales, this pole display unit allows customers to verify prices, feeds a lucid glare on user’s eye with a bright fluorescent display and high visibility, systemized with advanced circuitry algorithms to easily program custom messages, ingeniously adapts to your convenient posture with adjustable viewing angles. Being powered by USB, it disregards the need for an external power supply.</p>\r\n<p><strong>Features List:</strong></p>\r\n<ul>\r\n<li>Allows your customer to verify prices</li>\r\n<li>bright green fluorescent display and high visibility</li>\r\n<li>Logic Control LD9900UP</li>\r\n<li>easily program custom messages</li>\r\n<li>adjustable viewing angles</li>\r\n<li>Powered by USB- no external power supply needed</li>\r\n</lul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Character Number</strong></td>\r\n     <td>20 x 2 Lines</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Character Size</strong></td>\r\n    <td>0.24\" W x 0.37\" H</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Dimension Size</strong></td>\r\n    <td>8.5\" W x 3.4\" H x 1.8\" D</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Features</strong></td>\r\n    <td>UV resistant plastic; Optically matched lens for bright visibilty; Automatic message scrolling</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Connection Details</strong></td>\r\n    <td>USB interface</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Warranty</strong></td>\r\n    <td>3 year factory warranty</td>\r\n  </tr>\r\n</table>'),(136,4,73,0,17,'Pole Display'),(137,4,83,0,17,NULL),(138,4,106,0,17,NULL),(139,4,72,0,18,'<p>Churns out POS transaction quickly and enjoys strong appeal with retailers and service industry applications. Without separately connecting to a POS, it can be used as a one-time solution for all types of business electronic payment requirements. The users can rely on the powerful terminal for quick processing.</p>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Saves money on processing costs by having your customers use debit cards.</li>\r\n<li>Allows your customers to maintain possession of their credit and debit cards.</li>\r\n<li>Customers can pay with credit or PIN-based on debit cards</li>\r\n<li>Meets latest PCI PEC security standards.</li>\r\n<li>Requires Point Of Sale Merchant Service</li>\r\n<li>Works with Point Of Sale v.8 and higher.</li>\r\n<li>Accepts Smart Card, and Magstripe payment types</li>\r\n<li>Back lit operational keys</li>\r\n<li>Telium 2 technology</li>\r\n</ul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Manufacture’s Part No.</strong></td>\r\n     <td>431798</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Connection Type</strong></td>\r\n    <td>USB</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Dimension</strong></td>\r\n    <td>68 mm L x 83 mm W x 40 mm H</td>\r\n  </tr>\r\n</table>'),(140,4,73,0,18,'pos telium ipp350'),(141,4,83,0,18,NULL),(142,4,106,0,18,NULL),(196,4,72,0,19,'<p>The striking features of this convenient ,lightweight and handheld barcode scanner  include an ergonomic design with an LED indicator on encountering bar code, a rugged construction for durability and a USB interface that  weed out  the necessity of external power supply,</p>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Read quickly across high and low density bar codes.</li>\r\n<li>Sleek & ergonomic design for operator comfort and productivity.</li>\r\n<li>Rugged construction for durability.</li>\r\n<li>Scanner stand included.</li>\r\n<li>USB interface.</li>\r\n</ul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Scanner Make</strong></td>\r\n     <td>Honeywell Barcode Scanner 1300g</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Manufacturers Part No.</strong></td>\r\n    <td>431992</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Scanner Type</strong></td>\r\n    <td>Single Line Linear Imager</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Dimensions</strong></td>\r\n    <td>150 mm x 112 mm x 79 mm (5.9˝ x 4.4˝ x 3.1˝)</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Scanning Rate</strong></td>\r\n    <td>Up to 270 scans per second</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Minimum bar width</strong></td>\r\n    <td>3 mil</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Readable Format</strong></td>\r\n    <td>Reads standard 1D and GS1 DataBar<sup>™</sup> symbologies</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Interface</strong></td>\r\n    <td>USB</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Warranty</strong></td>\r\n    <td>5 Year Factory Warranty</td>\r\n  </tr>\r\n</table>'),(197,4,73,0,19,'QuickBooks pos barcode scanner'),(198,4,83,0,19,NULL),(199,4,106,0,19,NULL),(200,4,72,0,20,'<p>This <strong>TSP143II</strong> high speed and low cost thermal receipt printer is much more than its name delivers. Be it duplicate credit card slips or gift slips, it prints them all. To prevent manual & reckless receipt cutting which is vulnerable to misplaced tear-offs, it is loaded with an Auto-Cutter to slice the receipt smoothly. Designed smartly, it doesn’t let the paper get stuck and that easily load the drop-in-paper. What’s more, it gives you an option to connect many different devices through a common cable with a USB interface.</p>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Fast printing speed up to 125mm/sec</li>\r\n<li>High speed throughput: 28 receipts per minute </li>\r\n<li>Prints a receipt once a sale is complete.</li>\r\n<li>Prints duplicate credit card slips and gift slips.</li>\r\n<li>Easy drop-in paper loading.</li>\r\n<li>USB interface.</li>\r\n</ul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Print Speed</strong></td>\r\n     <td>125mm/sec (22 Receipts Per Minute)</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Print Resolution</strong></td>\r\n    <td>203 dpi (8 dots per mm)</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Paper Cutting</strong></td>\r\n    <td>Autocutting</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Interface Details</strong></td>\r\n    <td>USB Connection</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Printer Life</strong></td>\r\n    <td>60 Million Lines</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Cash Drawer Port</strong></td>\r\n    <td>1</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Driver Compatibility</strong></td>\r\n    <td>Windows 7 (32 bit / 64 bit), Windows 8 (32 bit / 64 bit), Windows® XP, Vista (32 bit / 64 bit), Server 2008 (32 bit / 64 bit), CE, XP Embedded, POS for .NET, OPOS<sup>™</sup>, JavaPOS<sup>™</sup>, USB Vendor Class, Linux<sup>™</sup> CUPS, Mac OS X (10.2 or later) CUPS</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Paper Width</strong></td>\r\n    <td>80mm (3.125 in) or 58mm (2.26”) with paper guide fitted</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Manufacture’s Part No.</strong></td>\r\n    <td>431931</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Warranty</strong></td>\r\n    <td>Year Factory Warranty</td>\r\n  </tr>\r\n</table>'),(201,4,73,0,20,'QuickBooks pos receipt printer'),(202,4,83,0,20,NULL),(203,4,106,0,20,NULL),(204,4,72,0,21,'<p>The direct thermal Zebra LP2824 printer, user-friendly, sleek, and so compact that it fits where other printers cant. It bags accolade for printing assorted line-up of prints such as inventory tags, barcode labels, address labels, file folder labels, shipping labels, and name tags. To boast of, it flaunts ingenious tools to design your own great appealing tags or labels. Plus, now sync with Bar Code Scanner to enter merchandise information faster & more accurately. Do more with USB interface to connect the printer to your PC or Mac, running Windows, Mac OS, or Linux.</p>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Print and design your own inventory tags and bar code labels.</li>\r\n<li>Pair with Bar Code Scanner to enter merchandise information faster & more accurately.</li>\r\n<li>Compact size fits into areas other printers can’t.</li>\r\n<li>USB interface.</li>\r\n</ul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Print Technology</strong></td>\r\n     <td>Direct Thermal</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Print Width</strong></td>\r\n    <td>2.2 inch (56mm) maximum</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Print Speed</strong></td>\r\n    <td>4 inch (102mm) per second / 200 dpi</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Maximum label Roll Diameter</strong></td>\r\n    <td>5 inches (127mm)</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Memory</strong></td>\r\n    <td>MB Flash, 8 MB SDRAM</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Drivers Available</strong></td>\r\n    <td>Windows XP, Windows Vista, Windows 2003, Windows 2008, Windows 7, Windows 8</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Connection Type</strong></td>\r\n    <td>Serial (RS232) and USB</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Warranty</strong></td>\r\n    <td>1 Year for printers (excluding print heads and other wear and tear parts) Manufacturer\'s warranty</td>\r\n  </tr>\r\n</table>'),(205,4,73,0,21,'Tag Printer'),(206,4,83,0,21,NULL),(207,4,106,0,21,NULL),(208,4,72,0,22,'<p>This robust, light-weight and single line laser barcode scanner is one of a kind. The reason being that it enjoys freedom to sustain a robust wireless long range Bluetooth Connectivity. Plus, It offers a field-replaceable battery that can be quickly and easily exchanged. Do more with USB interface to connect the printer to your PC or Mac, running Windows, Mac OS, or Linux.</p>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Read quickly across low and high density bar codes.</li>\r\n<li>Rugged construction for durability.</li>\r\n<li>Page help locate lost scanners.</li>\r\n<li>Bluetooth enabled.</li>\r\n<li>USB stand included.</li>\r\n</ul>\r\n<table class=\"tableSetCms\">\r\n  <tr>\r\n    <td><strong>Product Make</strong></td>\r\n     <td>Honeywell voyager 1202g</td>\r\n  </tr>\r\n  <tr>\r\n    <td><strong>Scanner type</strong></td>\r\n    <td>Single Line laser handheld barcode scanner</td>\r\n  </tr>\r\n  <tr>\r\n   <td><strong>Connectivity technology</strong></td>\r\n    <td>Wireless bluetooth</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Bar Code Dimension</strong></td>\r\n    <td>1D</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Bar Code Symbology Supported</strong></td>\r\n    <td>Reads standard 1D and GS1 DataBar symbologies</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Maximum Scan Resolution</strong></td>\r\n    <td>3.50 mil</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Decode Rate (lps)</strong></td>\r\n    <td>100 lps</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Battery Chemistry</strong></td>\r\n    <td>Lithium Ion (Li-Ion)</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Weight (Approximate)</strong></td>\r\n    <td>6.35 oz</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Dimension</strong></td>\r\n    <td>7.1”x 2.6”x 3.6”</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Green Compliant</strong></td>\r\n    <td>YES</td>\r\n  </tr>\r\n <tr>\r\n   <td><strong>Green Compliance Certificate/Authority</strong></td>\r\n    <td>RoHS, WEEE</td>\r\n  </tr>\r\n</table>'),(209,4,73,0,22,'Wireless Barcode Scanner'),(210,4,83,0,22,NULL),(211,4,106,0,22,NULL),(236,4,72,0,23,'<p>It includes QuickBooks Pro 2017 with Enhanced Payroll to help you organize your business finances and accounting on Windows PC. With all new Bill Tracker, now track your bill status at Real-Time, stay organized by setting and locating reminders from a single window and email invoices to your customers  and get paid fast by letting them pay you via credit card or bank transfer. On top of  them, organize all in one place by creating and customizing estimates, invoices, and statements, by managing vendors and expenses easily, by getting complete reports at tax –time and finally by downloading your online banking transactions directly into QuickBooks. Now easily pay employees, calculate and file payroll taxes with Payroll capabilities. 60-day money-back guarantee.</p>\r\n<p><strong>Special Benefits:</strong></p>\r\n<ul>\r\n<li>Includes a 1 year prepaid Enhanced Payroll subscription (includes 1 employee - easily add more (nominal fees apply)</li>\r\n</ul>\r\n<p><strong>What’s new:</strong></p>\r\n<ul>\r\n<li>With <strong>Bill Tracker</strong>, track your bill status at Real-Time and eliminate needs to gather data or run reports.</li>\r\n<li>Easily ship packages to the US and international destinations with integrated shipping through UPS, FedEx or USPS</li>\r\n</ul>\r\n<p><strong>What’s enhanced:</strong></p>\r\n<ul>\r\n<li>Declutter “Send forms” queue and manage forms in just single step.</li>\r\n<li>Advanced Reporting now features “this year to last month” filter.</li>\r\n</ul>\r\n<p><strong>Catch a glimpse of other features:</strong></p>\r\n<ul>\r\n<li>Create and print deposit slips</li>\r\n<li>Track and follow up on sales leads in the Lead Center</li>\r\n<li>Attach and store documents in the Document Center</li>\r\n<li>Create professional looking invoices and forms</li>\r\n<li>Track sales, sales taxes, and customer payments</li>\r\n<li>Easily print checks, pay bills, and track expenses</li>\r\n<li>Find all reminders and notifications in one single window.</li>\r\n<li>Complete everyday tasks faster with simplified customer forms</li>\r\n<li>Easier access to data and transactions with simplified navigation</li>\r\n<li>Invoice multiple customers for time and expenses in one batch</li>\r\n<li>See your invoices, billing, and other important tasks in a Calendar View</li>\r\n<li>View and pin important notes about customers, vendors, and employees</li>\r\n<li>Do more with add-on applications and services available in QuickBooks</li>\r\n<li>Track inventory, set reorder points, and create purchase orders</li>\r\n<li>Create a copy of your company file for your accountant</li>\r\n<li>Import data from Excel, Quicken, and prior QuickBooks versions</li>\r\n<li>Get a real-time view of your business with Company Snapshot</li>\r\n<li>Get insights to make better business decisions with the Report Center</li>\r\n<li>Import your contacts from Excel or other email address books</li>\r\n<li>Allow up to 3 users to work in QuickBooks at the same time</li>\r\n<li>Download bank and credit card transactions directly into QuickBooks</li>\r\n<li>Keep Customer, Vendor and Employee contact information at your finger tips</li>\r\n<li>See all your key customer information at a glance with the Customer Snapshot</li>\r\n<li>Set up Memorized Transactions for recurring billing, invoices, and estimates</li>\r\n<li>Save your worksheet formatting when you export QuickBooks reports to Excel</li>\r\n<li>Set individual user permissions to control access to sensitive information</li>\r\n<li>With income tracker, see all your income-producing transactions in one spot.</li>\r\n<li>Send invoices and estimates right from your business Yahoo!, Gmail, or Hotmail account</li>\r\n<li>Access industry-specific report templates created by other QuickBooks Premier users</li>\r\n<li>Easily save a copy of your company file on a shared folder directly from QuickBooks Premier.</li>\r\n<li>Get a complete overview of your business performance instantly on the new Homepage insights.</li>\r\n<li>Add multiple attachments, customize email templates and see prior email conversations with powerful email capabilities.</li>\r\n<li>Get your multiple bank accounts synchronized to pull in all your banking transactions and categorize them for tax-time.</li>\r\n<li>Track bounced checks, see key reports in just one click, and other improvements your customers asked for</li>\r\n</ul>\r\n<p><strong>Enhanced Payroll Features:</strong></p>\r\n<ul>\r\n<li>Save your time by getting your Payroll tax forms automatically filled out.</li>\r\n<li>Paychecks with 3 quick easy steps: just enter hours, approve salaries, and print paychecks instantly.</li>\r\n<li>Pay Payroll tax with quick calculations of federal and state taxes and few clicks to pay them electronically.</li>\r\n<li>Plus, get benefitted from unlimited payroll runs, job costs tracking, receiving instant W-2s at year end, and free support from Payroll experts.</li>\r\n</ul>\r\n'),(237,4,73,0,23,'QuickBooks pro 2017'),(238,4,83,0,23,NULL),(239,4,106,0,23,NULL),(240,4,72,0,24,'<p>It includes Quicken Deluxe 2016, a personal finance & budgeting solution to help reducing your debt, categorize your spending, and making budgeting/saving a no-brainer. Bundled up with everything packed inside the starter edition, it provides with full-scale budgeting functionality. Now receive ample gains from its new tools which let you see, track, & pay bills all in one place. Plus get satisfactorily served by free phone support. Whether you want to create a budget or import bank transactions securely, show all financial documents or bank/credit card balances, need help to save for house/college or plan for retirement, this product has it all to give your personal finance and budgeting experience an everlasting gratification.</p>\r\n<p><strong>What’s new:</strong></p>\r\n<ul>\r\n<li>See, track & pay bills in one place</li>\r\n<li>Free phone support</li>\r\n</ul>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Shows bank/credit card balances</li>\r\n<li>Imports bank transactions securely</li>\r\n<li>Puts your spending in categories</li>\r\n<li>Projects income and expenses</li>\r\n<li>Helps you create a budget</li>\r\n<li>Reminds you when bills are due</li>\r\n<li>Sends text/email alerts</li>\r\n<li>Syncs with free mobile app</li>\r\n<li>Snap and store receipts</li>\r\n<li>Free credit score and more</li>\r\n<li>Imports from previous Quicken versions</li>\r\n<li>Shows all financial accounts</li>\r\n<li>Helps you save for house/college</li>\r\n<li>Helps you plan for retirement</li>\r\n</ul>'),(241,4,73,0,24,'Quicken Deluxe 2016'),(242,4,83,0,24,NULL),(243,4,106,0,24,NULL),(244,4,72,0,25,'<p>It includes Quicken Rental Property Manager, a personal finance & Budgeting software to easily organize your rental property and personal finances all in one place. On top of finding tax-deductible rental property expenses you missed and managing your income and track expenses by property, the software grants full access to all the features from the Quicken Home & Business. In addition to that, store lease terms, rental rates, and security deposits by tenant and access personal finance data on the go with free Quicken mobile app. What’s more, now easily track bills, own free phone support and upgrade swiftly.</p>\r\n<p><strong>Benefits:</strong></p>\r\n<ul>\r\n<li>Automatically transfer data from previous Quicken versions.</li>\r\n<li>Export your Quicken data directly to TurboTax for accurate tax prep.</li>\r\n<li>60-day money-back guarantee.</li>\r\n</ul>\r\n<p><strong>What’s New:</strong></p>\r\n<ul>\r\n<li>Link your bills and Quicken will automatically track the due date and amount due</li>\r\n<li>Now easier to convert from Quicken Windows to Quicken Mac.</li>\r\n<li><strong>Increased reliability and accuracy of bank downloads and transactions</strong> by eliminating duplicate transactions.</li>\r\n<li>Free phone support</li>\r\n</ul>\r\n<p><strong>Catch a glimpse of the features:</strong></p>\r\n<ul>\r\n<li>Manage all your banking, credit card, loan, 401(k), and investing accounts in one place.</li>\r\n<li>Your income and expenses are automatically downloaded and categorized for you.</li>\r\n<li>Tracks incomes and expenses for each property you own.</li>\r\n<li>Compare profit and loss from all your rentals. See which are most profitable.</li>\r\n<li>Easily find tenant info, such as lease terms, security deposits, and payment history.</li>\r\n<li>Record rent collected, partial payments, and late fees.</li>\r\n<li>Categorizes your personal and rental property expenses for tax purposes.</li>\r\n<li>Create Schedule E and Schedule C reports, or even export your data directly to TurboTax.</li>\r\n<li>Check assets, liabilities, and net worth in one click.</li>\r\n<li>Makes tax time easier, as cost basis and capital gains are tracked and estimated for you.</li>\r\n<li>Link your bills and Quicken will automatically track the due date and amount due.</li>\r\n<li>Easily create, save, and print professional-looking estimates and invoices.</li>\r\n<li>Create a custom plan to reduce debt.</li>\r\n<li>Get free credit monitoring alerts, credit score, and report summary.</li>\r\n</ul>'),(245,4,73,0,25,'Quicken Rental Property'),(246,4,83,0,25,NULL),(247,4,106,0,25,NULL),(248,4,72,0,26,'<p>It includes Quicken Starter Edition, your one stop gateway to easy money management. Access your bank and credit accounts all in one place and save crucial hours. Make budgeting painless by categorizing your expenses automatically. Stay up to date with upcoming paychecks, bills and payments to avoid fee getting overdue.  What’s more, now see, track and pay your bills all in one place.</p>\r\n<p><strong>Benefits:</strong></p>\r\n<ul>\r\n<li>Free ongoing enhancements & updates included through April 2019</li>\r\n<li>Easily imports your data from earlier versions of Quicken</li>\r\n<li>60 day money-back guarantee</li>\r\n</ul>\r\n<p><strong>What’s new:</strong></p>\r\n<ul>\r\n<li>Link your bills and Quicken will automatically track the due date and amount due</li>\r\n<li>Improved reliability and accuracy of bank downloads and transactions</li>\r\n<li>Now even easier to upgrade</li>\r\n<li>Free phone support</li>\r\n</ul>\r\n<p><strong>Benefits:</strong></p>\r\n<ul>\r\n<li>Securely and automatically download your income and expenses from your bank and credit cards into one place</li>\r\n<li>Automatically tracks and categorizes your expenses so you don’t have to know how much you can spend with forecasted balances</li>\r\n<li>Get free credit monitoring alerts, credit score, and report summary</li>\r\n<li>Automatically sets up budget goals based on past spending</li>\r\n<li>Customize your plan, and let Quicken track your progress</li>\r\n<li>See upcoming paychecks, bills and payments to avoid late fees</li>\r\n<li>Set custom alerts for large deposits, fees or over spending so you\'ll always know where you stand</li>\r\n<li>Know exactly where you stand with your bills and cash flow without having to log into multiple accounts</li>\r\n<li>Easily pay your bills on time from right within Quicken</li>\r\n<li>Snap and store receipts to easily track important purchases</li>\r\n<li>Sync information between your computer, tablet, and smart phone</li>\r\n</ul>'),(249,4,73,0,26,'Quicken Starter edition'),(250,4,83,0,26,NULL),(251,4,106,0,26,NULL),(252,4,72,0,27,'<p>With QuickBooks Enterprise 2017, find compelling cool new features like Bill tracker, payment screen search option, single-label printing, and Auto-Copy Ship-to-Address capabilities along with many smart tools bundled from its previous version. Run your most critical business reports at ease with <strong>Advance Reporting</strong> feature inside Silver Edition. Also, it comes with an <strong>annual subscription</strong> with one year included at initial purchase.</p>\r\n<p><strong>Benefits:</strong></p>\r\n<ul>\r\n<li><strong>Advanced Reporting</strong> functionality lets you glean from the reports that manufacturers, wholesalers, contractors, and retailers have found the most useful. Auto-filled template reports saves your time and the comprehensive help portal gives you the right tools to find the right solution. </li>\r\n</ul>\r\n<p><strong>What’s new:</strong></p>\r\n<ul>\r\n<li>With <strong>Bill Tracker</strong>, track all your bills to see what’s on order, what you owe, and what you’ve paid.</li>\r\n<li>Now with <strong>Payment Screen Search Options</strong>, sort any column in the payment screen to find the customer transaction you have been looking for!</li>\r\n<li>Now forget about manually inputting addresses from service order to purchase order when it’s just a matter of a click to auto copy them with all new<strong> Auto-Copy ship-to-address function</strong>.</li>\r\n<li> The all new <strong>single label printing capabilities</strong> give you the freedom to print barcodes, address labels, and more on single, continuous feed label printers, such as Zebra.</li>\r\n<li>With all new <strong>Batch delete tool</strong>, a large number of transactions classified under the wrong department or office can be deleted all at once.</li>\r\n</ul>\r\n<p><strong>What’s improved:</strong></p>\r\n<ul>\r\n<li>Thanks <strong>to Advanced Reporting</strong>, now run your most critical business reports with ease.</li>\r\n<li>With <strong>E-invoicing</strong>, now email invoices to your customers with a Pay Now link and let all completed payments be automatically updated to the invoice record.</li>\r\n<li>Enhancements and a bit of tweaking on <strong>individual assembly shortage report</strong> have been made to help you seek information on quantity for assemblies, quantity on sales, and many more.</li>\r\n<li> The improved <strong>Inventory troubleshooting process</strong> easily analyzes, carry out adjustments, and stack up the tools to keep a vigil on negative inventory.</li>\r\n<li>By mistake, you misclassified a number of transactions under the wrong department and you couldn’t find a tool to fix that. With <strong>Batch reclassify and entry tools</strong>, fixing and entering transactions in bulk is now a reality.</li>\r\n<li>What’s more, several <strong>powerful tools for accountants</strong> have been unlocked to give freedom on software utility. From writing off an outstanding invoice to speeding up account discrepancies to easily segmenting your books with <strong>period copy reporting capabilities</strong>, there are many more to off-load your burden and save your time.</li>\r\n</ul>\r\n<p><strong>Additionally:</strong></p>\r\n<ul>\r\n<li>Quickly prioritize customers with the new Customer Snapshot</li>\r\n<li>Stay on top of your receivables with the new Collections Center</li>\r\n<li>Create customer reports with OBDC-compliant applications using a new direct connection to the QuickBooks database.</li>\r\n<li> Work in two company ﬁles at one time.</li>\r\n<li>Connect multiple locations and remote workers via Remote Desktop Services.</li>\r\n<li>Combine reports from multiple company ﬁles and create professional ﬁnancial statements.</li>\r\n<li>Track the quantity and value of inventory in multiple locations.</li>\r\n</ul>'),(253,4,73,0,27,'QuickBooks enterprise'),(254,4,83,0,27,NULL),(255,4,106,0,27,NULL),(350,4,72,0,33,'<p>It includes QuickBooks Pro 2017 software which helps you organize your business finances and accounting on a Windows PC. Save time with the all new Bill Tracker which tracks your bill status at Real-Time, stay organized by setting and locating reminders from a single window and email invoices to your customersÂ  and get paid fast by letting them pay you via credit card or bank transfer. On top ofÂ  them, organize everything in one place by creating and customizing estimates, invoices, and statements, by managing vendors and expenses easily, by getting complete reports at tax â€“time and finally by downloading your online banking transactions directly into QuickBooks. It inc