insert  into `catalogsearch_fulltext`(`fulltext_id`,`product_id`,`store_id`,`data_index`) values (245,15,1,'None|QuickBooks premier 2017 small business accounting software with industry editions|It includes QuickBooks Premiere 2017, tailor-made to your industry and bundled with all features packed inside Pro and Plus, it boasts of industry specific features as well(not limited to General Business, Contractor, Manufacturing & Wholesale, Non-Profit, Professional Services, and Retail). With all new Bill Tracker, now track your bill status at real-time, set and locate reminders from a single window, email invoices to your customers, and get paid fast by letting them pay you via credit card or bank transfer. Organize all in one place by creating and customizing estimates, invoices, and statements, by managing vendors and expenses easily, by getting complete reports at tax –time and finally downloading your online banking transactions directly into QuickBooks. 60-day money-back guarantee. What’s new: With Bill Tracker, track your bill status at Real-Time and eliminate needs to gather data or run reports. What’s enhanced: Declutter “Send forms” queue and manage forms in just single step. Advanced Reporting now features “this year to last month” filter. Catch a glimpse of other important features: Create and print deposit slips Document and track change orders. Run \'Cost to Complete Job\' report. Bill clients progressively by job phase. Find all reminders and notifications in one single window. View customized sales and profitability reports Track and follow up on sales leads in the Lead Center Attach and store documents in the Document Center Create professional looking invoices and forms Track sales, sales taxes, and customer payments Easily print checks, pay bills, and track expenses Complete everyday tasks faster with simplified customer forms Do more with add-on applications and services available in QuickBooks View and pin important notes about customers, vendors, and employees Easier access to data and transactions with simplified navigation Invoice multiple customers for time and expenses in one batch See your invoices, billing, and other important tasks in a Calendar View View shipping rates, print labels, and track packages through UPS, FedEx or USPS With income tracker, see all your income-producing transactions in one spot. Keep Customer, Vendor and Employee contact information at your finger tips Access your inventory items all in one place with the Inventory Center Track inventory, set reorder points, and create purchase orders Get a real-time view of your business with Company Snapshot Get insights to make better business decisions with the Report Center Import your contacts from Excel or other email address books Allow up to 5 users to work in QuickBooks at the same time Set individual user permissions to control access to sensitive information Create a copy of your company file for your accountant Import data from Excel, Quicken, and prior QuickBooks versions Download bank and credit card transactions directly into QuickBooks Track your balance sheet by class such as a location, department, or profit center Track time and expenses by employee, project, client, or service. Set up Memorized Transactions for recurring billing, invoices, and estimates Save your worksheet formatting when you export QuickBooks reports to Excel See all your key customer information at a glance with the Customer Snapshot Access industry-specific report templates created by other QuickBooks Premier users Send invoices and estimates right from your business Yahoo!, Gmail, or Hotmail account Easily save a copy of your company file on a shared folder directly from QuickBooks Premier. Track bounced checks; see key reports in just one click, and other improvements your customers asked for. Get a complete overview of your business performance instantly on the new Homepage insights. Get your multiple bank accounts synchronized to pull in all your banking transactions and categorize them for tax-time. Add multiple attachments, customize email templates and see prior email conversations with powerful email capabilities.|QuickBooks premier|349.99|1'),(262,54,1,'None|dasd|dasd|dasd|150|player |1'),(261,52,1,'None|QuickBooks enterprise 2017 platinum edition 1 year subscription download|With QuickBooks Enterprise 2017, find compelling cool new features like Bill tracker, payment screen search option, single-label printing, and Auto-Copy Ship-to-Address capabilities along with many smart tools bundled from its previous version. Packed with maximum functionality, it offers all what Gold edition does in addition to valuable tools for manufacturers, wholesalers, contractors, and retailers. Own exclusive rights to QuickBooks Advanced Inventory and Advanced Pricing packaged inside this platinum edition. Also, it comes with an annual subscription with one year included at initial purchase. Benefits: The all new QuickBooks Advanced Inventory connects the company’s inventory data with financial transactions and make the process efficient. Loaded with Advanced pricing functionality, this edition lets you control, customize, and automate your pricing, right within QuickBooks. QuickBooks Enhanced payroll bundled with unlimited paychecks and no monthly employee fees is loaded with powerful functionality to pay and file taxes, pay employees, and streamline your payroll. Advanced Reporting functionality lets you glean from the reports that manufacturers, wholesalers, contractors, and retailers have found the most useful. Auto-filled template reports saves your time and the comprehensive help portal gives you the right tools to find the right solution. What’s new: With Bill Tracker, track all your bills to see what’s on order, what you owe, and what you’ve paid. Now with Payment Screen Search Options, sort any column in the payment screen to find the customer transaction you have been looking for! Now forget about manually inputting addresses from service order to purchase order when it’s just a matter of a click to auto copy them with all new Auto-Copy ship-to-address function. The all new single label printing capabilities give you the freedom to print barcodes, address labels, and more on single, continuous feed label printers, such as Zebra. With all new Batch delete tool, a large number of transactions classified under the wrong department or office can be deleted all at once. What’s improved: Thanks to Advanced Reporting, now run your most critical business reports with ease. With E-invoicing, now email invoices to your customers with a Pay Now link and let all completed payments be automatically updated to the invoice record. Enhancements and a bit of tweaking on individual assembly shortage report have been made to help you seek information on quantity for assemblies, quantity on sales, and many more. The improved Inventory troubleshooting process easily analyze, carry out adjustments, and the tools to keep a vigil on negative inventory. By mistake, you misclassified a number of transactions under the wrong department and you couldn’t find a tool to fix that. With Batch reclassify and entry tools, fixing and entering transactions in bulk is now a reality. What’s more, several powerful tools for accountants have been unlocked to give freedom on software utility. From writing off an outstanding invoice to speeding up account discrepancies to easily segmenting your books with period copy reporting capabilities, there are many more to off-load your burden and save your time. Additionally: Quickly prioritize customers with the new Customer Snapshot Stay on top of your receivables with the new Collections Center Create customer reports with OBDC-compliant applications using a new direct connection to the QuickBooks database. Work in two company ﬁles at one time. Connect multiple locations and remote workers via Remote Desktop Services. Combine reports from multiple company ﬁles and create professional ﬁnancial statements. Track the quantity and value of inventory in multiple locations.|QuickBooks enterprise|1600|1'),(254,24,1,'None|Quicken Deluxe 2016 personal finance budgeting software|It includes Quicken Deluxe 2016, a personal finance & budgeting solution to help reducing your debt, categorize your spending, and making budgeting/saving a no-brainer. Bundled up with everything packed inside the starter edition, it provides with full-scale budgeting functionality. Now receive ample gains from its new tools which let you see, track, & pay bills all in one place. Plus get satisfactorily served by free phone support. Whether you want to create a budget or import bank transactions securely, show all financial documents or bank/credit card balances, need help to save for house/college or plan for retirement, this product has it all to give your personal finance and budgeting experience an everlasting gratification. What’s new: See, track & pay bills in one place Free phone support Catch a glimpse of the features: Shows bank/credit card balances Imports bank transactions securely Puts your spending in categories Projects income and expenses Helps you create a budget Reminds you when bills are due Sends text/email alerts Syncs with free mobile app Snap and store receipts Free credit score and more Imports from previous Quicken versions Shows all financial accounts Helps you save for house/college Helps you plan for retirement|Quicken Deluxe 2016|74.95|1'),(255,25,1,'None|Quicken Rental Property manager 2016 personal finance budgeting software|It includes Quicken Rental Property Manager, a personal finance & Budgeting software to easily organize your rental property and personal finances all in one place. On top of finding tax-deductible rental property expenses you missed and managing your income and track expenses by property, the software grants full access to all the features from the Quicken Home & Business. In addition to that, store lease terms, rental rates, and security deposits by tenant and access personal finance data on the go with free Quicken mobile app. What’s more, now easily track bills, own free phone support and upgrade swiftly. Benefits: Automatically transfer data from previous Quicken versions. Export your Quicken data directly to TurboTax for accurate tax prep. 60-day money-back guarantee. What’s New: Link your bills and Quicken will automatically track the due date and amount due Now easier to convert from Quicken Windows to Quicken Mac. Increased reliability and accuracy of bank downloads and transactions by eliminating duplicate transactions. Free phone support Catch a glimpse of the features: Manage all your banking, credit card, loan, 401(k), and investing accounts in one place. Your income and expenses are automatically downloaded and categorized for you. Tracks incomes and expenses for each property you own. Compare profit and loss from all your rentals. See which are most profitable. Easily find tenant info, such as lease terms, security deposits, and payment history. Record rent collected, partial payments, and late fees. Categorizes your personal and rental property expenses for tax purposes. Create Schedule E and Schedule C reports, or even export your data directly to TurboTax. Check assets, liabilities, and net worth in one click. Makes tax time easier, as cost basis and capital gains are tracked and estimated for you. Link your bills and Quicken will automatically track the due date and amount due. Easily create, save, and print professional-looking estimates and invoices. Create a custom plan to reduce debt. Get free credit monitoring alerts, credit score, and report summary.|Quicken Rental Property|164.99|1'),(256,26,1,'None|Quicken Starter edition 2016 personal finance budgeting software|It includes Quicken Starter Edition, your one stop gateway to easy money management. Access your bank and credit accounts all in one place and save crucial hours. Make budgeting painless by categorizing your expenses automatically. Stay up to date with upcoming paychecks, bills and payments to avoid fee getting overdue. What’s more, now see, track and pay your bills all in one place. Benefits: Free ongoing enhancements & updates included through April 2019 Easily imports your data from earlier versions of Quicken 60 day money-back guarantee What’s new: Link your bills and Quicken will automatically track the due date and amount due Improved reliability and accuracy of bank downloads and transactions Now even easier to upgrade Free phone support Benefits: Securely and automatically download your income and expenses from your bank and credit cards into one place Automatically tracks and categorizes your expenses so you don’t have to know how much you can spend with forecasted balances Get free credit monitoring alerts, credit score, and report summary Automatically sets up budget goals based on past spending Customize your plan, and let Quicken track your progress See upcoming paychecks, bills and payments to avoid late fees Set custom alerts for large deposits, fees or over spending so you\'ll always know where you stand Know exactly where you stand with your bills and cash flow without having to log into multiple accounts Easily pay your bills on time from right within Quicken Snap and store receipts to easily track important purchases Sync information between your computer, tablet, and smart phone|Quicken Starter edition|39.95|1'),(257,27,1,'None|QuickBooks enterprise 2017 silver edition|With QuickBooks Enterprise 2017, find compelling cool new features like Bill tracker, payment screen search option, single-label printing, and Auto-Copy Ship-to-Address capabilities along with many smart tools bundled from its previous version. Run your most critical business reports at ease with Advance Reporting feature inside Silver Edition. Also, it comes with an annual subscription with one year included at initial purchase. Benefits: Advanced Reporting functionality