ame suggests, we are the ace professionals engaged in trading Intuit software and QuickBooks Point of Sale devices and set a platform for customers to explore a wide range of payroll products which once bought, let customers pay smartly to their employees.</p>\r\n<p>The products include QuickBooks Enterprise, QuickBooks Online Essentials, QuickBooks Pro, and Quicken Home &amp; Business, to name a few. To help ring up your sales fast and manage your inventory inside out, we supply QuickBooks Point of Sale hardware peripherals like QuickBooks POS MSR and QuickBooks POS barcode Scanner and many more.</p>\r\n<p>With our decision to back those befuddled customers who are constantly in need of advising support, we have also forayed into QuickBooks and tax planning consultancy. Resolve your issues quickly by asking queries to our highly dedicated experts standing by and with unlimited chat and phone support, get help when you need it.</p>\r\n<p>What differentiates us from rest of the others is our proven track record of selling products at 100% conversion rate that firmly resonates with our deeply ingrained commitment to offer only the bestsellers. In addition, our consultancy solution matches the industry specific standards of the highest order which has only been made possible by our resolute and highly dedicated pool of consulting experts.</p>\r\n</div>\r\n</div>','2016-10-26 12:34:12','2016-11-11 11:19:01',1),(21,'Support for QuickBooks','support-for-quickbooks','<!--<div class=\"descriptionSupport\"><p>24x7 support<br>for all versions of<br><span class=\"quickBook\">QuickBooks</span><br><span class=\"supportCall\">Call Now : 1-844-649-1813</span></p></div>-->\r\n<div class=\"supportPage\">\r\n<div class=\"col-1\">\r\n<p>To get the maximum benefit out of <strong>QuickBooks</strong> and in order to maximize your total productivity, we always recommend you to subscribe for a support system. With a 24*7 support backup, you will be easily able to grow your business.</p>\r\n<p>Our customized <strong>QuickBooks</strong> support is sure to help you resolve your <strong>QuickBooks</strong> errors or problems in minimum time possible and with the best solutions. We offer dedicated support needed to resolve the numerous issues faced by <strong>QuickBooks</strong> users. MyDigitalPayroll strives to build a trustworthy and transparent relation with our customers and thus offers a 24X7 support to the associated customers.</p>\r\n<p>For any help/queries related to <strong>QuickBooks</strong>. Please call - 1-844-649-1813<br />\r\nWe do provide support for all versions of <strong>QuickBooks</strong> like – <strong>QuickBooks</strong> 2016, <strong>QuickBooks</strong> 2015, <strong>QuickBooks</strong> 2014, <strong>QuickBooks</strong> 2013, <strong>QuickBooks</strong> 2012, <strong>QuickBooks</strong> 2011, <strong>QuickBooks</strong> 2010, <strong>QuickBooks</strong> 2009, <strong>QuickBooks</strong> 2008, <strong>QuickBooks</strong> Enterprise, <strong>QuickBooks</strong> Premier, <strong>QuickBooks</strong> Payroll, <strong>QuickBooks</strong> Basic Payroll, <strong>QuickBooks</strong> Pro, <strong>QuickBooks</strong> Enhanced Payroll & <strong>QuickBooks</strong>Point of Sale etc..</p>\r\n<div class=\"quickBook4Image\">\r\n<div class=\"supportHeading\"><h1>Common Problems While Using QuickBooks Software:-</h1></div>\r\n<img src=\"{{media url=\"wysiwyg/quickbooks4Image.jpg\"}}\" alt=\"\" />\r\n</div>\r\n<h2>1: Error -6209, 0 while opening a QuickBooks file.</h2>\r\n<p><strong>Issue :</strong>  Error -6209 when updating Windows, installing QuickBooks, or trying to open a QuickBooks file</p>\r\n<p><strong>Reason :</strong> This happens due to damaged component of Microsoft .NET Framework.<br>\r\n<strong>Fix : a)</strong> Repair QuickBooks.</p>\r\n\r\n<ul class=\"firstSupportUl\">\r\n<li>Open control panel</li>\r\n<li>open program & feature.</li>\r\n<li>Uninstall QuickBooks. ( during uninstallation  process it will give you an option to repair)</li>\r\n<li>Reboot the system</li>\r\n</ul>\r\n<p>try to Use quickBooks & see if it worked. If not proceed with the 2nd option.<br>\r\n<strong>b)</strong> Repair or reinstall Microsoft .NET Framework.</p>\r\n<ul>\r\n<li>Open control panel</li>\r\n<li>open program & feature.</li>\r\n<li>Uninstall Microsoft .net framework ( during uninstallation  process it will give you an option to repair)</li>\r\n<li>Reboot the system</li>\r\n<li>These simple steps should resolve error  -6209, 0</li>\r\n</ul>\r\n<h2>2 : Error -6000,-100 while opening or installing QuickBooks.</h2>\r\n<p><strong>Cause :</strong> This error can occur in a number of different situations.</p>\r\n<ul>\r\n<li>The .ND file gets damaged.</li>\r\n<li>NOD32 Antivirus Software.</li>\r\n<li>registry issue of computer.</li>\r\n</ul>\r\n<p>How to Fix this Error -6000,-100</p>\r\n<p>There can be more than one solution to to this problem. if the 1st solution doesn’t help then continue with 2nd, 3rd, 4th & then 5th.</p>\r\n<p><strong>Solution1:</strong> toggle the hosting mode.<br>\r\nFile-Utilities-stop hosting multi-user mode.<br>\r\nonce done try opening QuickBooks, If you continue to get the same error proceed with solution 2</p>\r\n<p><strong>Solution 2:</strong> rename .nd file.<br>\r\nLocate the .nd files with the name of the company having trouble opening & rename it to something else & try opening QuickBooks.<br>\r\nIf you continue to get the same error proceed with solution 3.</p>\r\n<p><strong>Solution 3:</strong> (only if you are running NOD32 Antivirus Software)<br>\r\nOpen NOD32 antivirus & disable IMON functionality. once done restart the computer && open QuickBooks.<br>\r\nIf you continue to get the same error proceed with solution 4.</p>\r\n<p><strong>Solution 4:</strong> run reboot.bat.<br>\r\nOpen the folder containing the reboot.bat file:<br>\r\n• Windows 8, 7 or Vista</p>\r\n<p>Right-click the QuickBooks icon on your desktop and select Properties.<br>\r\nClick Open file location.</p>\r\n<ul>\r\n<li>Window XP:</li>\r\n</ul>\r\n<p>Right-click the QuickBooks icon on your desktop and select Properties.<br>\r\nClick Find Target.</p>\r\n<p>Right-click on reboot.bat and choose Run as Administrator.  Note: This step is important, you need to run reboot.bat as Admin.</p>\r\n<p>Check to see if this resolves the issue.  If not, reboot your computer.<br>\r\nIf you continue to get the same error proceed with solution 4</p>\r\n<p><strong>Solution 5:</strong> Go for a clean install.</p>\r\n<h2>Error -3 : QuickBooks Online to QuickBooks desktop Conversion</h2>\r\n<p>Facing problem with QuickBooks online to QuickBooks desktop conversion? Follow these simple and easy steps.</p>\r\n<ul>\r\n<li>First login to your online QuickBooks account. Click on the Company tab and select Export Data from the More drop down menu.</li>\r\n<li>Now start the export interview.</li>\r\n<li>Select the data to import.</li>\r\n<li>Choose your QuickBooks desktop edition version and click Next.</li>\r\n<li>Approve the special conditions once you read it. This will let you know how your data will be changed after the export process is complete.</li>\r\n<li>You will be requested to enter your name & email id</li>\r\n</ul>\r\n<p>After you complete this process, you will get an email with steps you need to follow to complete the export conversion within 24 hours. Once you get the email, open your file in your QuickBooks desktop edition and follow the steps below.</p>\r\n<ul>\r\n<li>Now, go to your company Home page in QuickBooks Online & click on the Home icon</li>\r\n<li>Download the company file you have created by clicking the task.</li>\r\n<li>Select the option to move yourdata to a desktop version of QuickBooks Online.</li>\r\n<li>And Click Download</li>\r\n<li>Name the file as you desire and click save when the pop-up window appears.</li>\r\n<li>Close all companies and windows in it and start the QuickBooks you want to use. Once you start the QuickBooks, click convert.</li>\r\n<li>Once you click convert, the conversion process will begin.</li>\r\n<li>When you’ve located the certificate, click Yes, prompt each time or Yes, this time then click Continue.</li>\r\n<li>A pop-up window will appear confirming that you’ve granted access.  Click Done.</li>\r\n</ul>\r\n<h2>Error – 4: Error Warning while Opening QuickBooks.</h2>\r\n<p>Are you getting this error warning image everything you open your QuickBooks, worry not. This can be solved with some simple steps. </p>\r\n<img src=\"{{media url=\"wysiwyg/quickbooksErrorImage.jpg\"}}\" alt=\"\" />\r\n<p><strong>Cause</strong><br>\r\nWhen updates are downloaded by Quickbooks but Window can’t install the updates because of user permission or User Account Control settings in Windows Vista or     Windows 7 or 8, this error occurs.</p>\r\n<p><strong>How to Fix</strong></p>\r\n<p><strong>Solution 1:</strong> Run your QuickBooks as administrator<br>\r\nRight click on QuickBooks program icon on your desktop and select “Run as Administrator“.</p>\r\n<p><strong>Solution 2:</strong>  Please make sure that all Windows permissions are set correctly for QuickBooks to function.</p>\r\n<ul>\r\n<li>Close Quick Books.</li>\r\n<li>Navigate to C:\\Program Files\\ through Windows Explorer.</li>\r\n<li>Select the option to move yourdata to a desktop version of QuickBooks Online.</li>\r\n<li>Now, right-click on the Intuit folder.</li>\r\n<li>Select Properties.</li>\r\n<li>Click the Security tab.</li>\r\n<li>Click the Advanced button.</li>\r\n<li>Click the Owner tab.</li>\r\n</ul>\r\n<p>Make sure that the Users group is selected in the Current Owner field up top. If anything besides Users, such as System is displayed, you will have totake ownership of the Intuit folder. Now select Users (YOUR COMPUTER NAME\\Users) and make sure the Full Control has a check mark in it.</p>\r\n<p>Click Ok and exit the Intuit folder properties window.<br>\r\nThis should resolve your issue but if you are still facing the same issue, you will have to repeat these steps for these additional Intuit folder locations:</p>\r\n<ul>\r\n<li>C:\\Program Files\\Common Files\\Intuit (Note: if you are on a 64bit computer, you will need to use C:\\Program Files (x86)\\Common Files\\Intuit)</li>\r\n<li>C:\\ProgramData\\Intuit</li>\r\n<li>C:\\Users\\Your User Name\\AppData\\Local\\Intuit</li>\r\n</ul>\r\n<p><strong>Solution 3:</strong>  Please check if there is any update for your QuickBooks.<br>\r\n<strong>Solution 4:</strong>  If nothing else work, go for a clean Install.</p>\r\n<ul>\r\n<li><strong>QuickBooks</strong> Installation Support</li>\r\n<li><strong>QuickBooks</strong> Update Support</li>\r\n<li><strong>QuickBooks</strong> Upgrade Support</li>\r\n<li><strong>QuickBooks</strong> Error Support</li>\r\n<li><strong>QuickBooks</strong> Data Migration Support</li>\r\n<li><strong>QuickBooks</strong> Integration Support</li>\r\n<li><strong>QuickBooks</strong> Registration Support</li>\r\n<li><strong>QuickBooks</strong> Activation Support</li>\r\n<li><strong>QuickBooks</strong> Download Support</li>\r\n<li><strong>QuickBooks</strong> Troubleshooting Support</li>\r\n<li>Support for <strong>QuickBooks</strong> When <strong>QuickBooks</strong> Not Working Properly</li>\r\n<li>Support for <strong>QuickBooks</strong> When <strong>QuickBooks</strong> Not Responding</li>\r\n<li><strong>QuickBooks</strong> Sync Support</li>\r\n<li>Support for <strong>QuickBooks</strong> Transactions</li>\r\n<li>Support for <strong>QuickBooks</strong> Company File</li>\r\n<li>Support for <strong>QuickBooks</strong> Conversion</li>\r\n<li><strong>QuickBooks</strong> Troubleshooting Support</li>\r\n<li><strong>QuickBooks</strong> Backup Support</li>\r\n<li><strong>QuickBooks</strong> Network Support</li>\r\n<li><strong>QuickBooks</strong> Multi – User Support</li>\r\n<li><strong>QuickBooks</strong> Invoice Support</li>\r\n<li><strong>QuickBooks</strong> Export Support</li>\r\n<li><strong>QuickBooks</strong> Import Support</li>\r\n<li><strong>QuickBooks</strong> Licensing Support</li>\r\n<li><strong>QuickBooks</strong> Payroll Support</li>\r\n<li><strong>QuickBooks</strong> Recovery Support</li>\r\n<li>Support for Slow <strong>QuickBooks</strong> </li>\r\n<li>Support to Open <strong>QuickBooks</strong></li>\r\n<li><strong>QuickBooks</strong> Renewal Support</li>\r\n<li>Help to Repair <strong>QuickBooks</strong></li>\r\n<li><strong>QuickBooks</strong> Mac Support</li>\r\n</ul>\r\n<p>Our <strong>QuickBooks</strong> Technical Support team promises to resolve all your problems in least possible time so that your work in not hampered. To get this in the right way, we have appointed well qualified and experienced professionals who possess all the required knowledge and skills to assist and solve your problems.</p>\r\n<p>We understand the fact that there are varying requirements for support and the needs vary with every client. For this we offer a wide array of options that are designed to best match your needs.<br>\r\nTelephone and email assistance <strong>– call on 1-844-649-1813 or email <a style=\"text-decoration:underline;color: #333333;\" href=\"mailto:support@mydigitalpayroll.com\">support@mydigitalpayroll.com</a></strong></p>\r\n</div>\r\n</div>','2016-10-27 12:22:57','2016-11-02 18:01:46',1),(22,'Features','features','<div class=\"featuresPage\">\r\n<div class=\"col-1\">\r\n<p>Building a website is not so hard nowadays. But still there are certain little secrets and tiny ways you should follow in order to achieve the best results.<br>\r\nOf course there are a lot of different factors that can influence your success and it is hard to keep all them in mind. But in fact you should know only few most important secrets for your website to be a success.</p>\r\n<p><strong>1. An Eye-catching Design</strong></p>\r\n<p>What is attracting the visitors first is a very design of your website. It shouldn’t be irritating – neither dull nor too flashy.<br>\r\nThe main purpose of your website’s attractive design is to keep the visitor and make him stay online for further actions. In this case even color gamut will influence user’s mood and can win his or her favor or quickly lose it.<br>\r\nSo the first helpful hint for you is to think over your website’s design thoroughly. If you succeed at this stage you can make use of the following points.</p>\r\n<p><strong>2. Convenient Navigation</strong></p>\r\n<p>It is clear that you visit a lot of websites every day and not all of them please you while surfing. Coming to a website you want the interface to be easy and understandable, right? So let it not be a secret for you anymore – your visitors want the same.<br>\r\nThink about placing all the links on your website in such a way that the user won’t become irritated by not knowing where to click at. It is a significant point not to confuse the visitor of your website and thus not to make him leave and forget about its existence.</p>\r\n<p><strong>3. Proper Content</strong></p>\r\n<p>What the users like very much is a content they are promised to see on the website. You better not play with it.<br>\r\nOnce disappointed the visitor may not come again to see whether something has changed. So make sure your website contains enough useful information to make the user interested and then your further updates will really make sense.<br>\r\nDon’t forget about some helpful information concerning your website operating. All the users appreciate the possibility to find the accurate answers for their questions.</p>\r\n<p><strong>4. Contact Information</strong></p>\r\n<p>It is essential some problems may arise during someone is wandering pages of your website. Perhaps not problems but specific questions for sure. Anyway you should persuade the visitor that he or she may always rely on your support.<br>\r\nIt is not that good when a user can’t find the way to contact you. So be attentive to put all necessary contact information (e-mail address, phone number, a link leading to a special contact form etc) in such a way that the visitor can easily find and make use of it.<br>\r\nYou should really mind that fact if you want your web presence to be evaluated not only as qualitative but also supportive and responsible one.</p>\r\n<p><strong>5. Search Option</strong></p>\r\n<p>In case your website is crammed with different information it will be very convenient for the user to find the necessary content with the help of search field. All he/she has to do is type some keywords and then check the results of the search process.<br>\r\nProviding the visitors with search option will let them find what they are eager to quickly and easily, and believe they will be much pleased with such possibility.<br>\r\nYou can use either a Google Search or your Content Management System to establish a search function on your website.</p>\r\n<p><strong>6. Sign-Up Form</strong></p>\r\n<p>It is very important for the user not to spend hours in search of “Sign-up” or “Register” button.<br>\r\nRemember that all the necessary fields and links have to be easily found by the visitor. Otherwise you may start losing your clients as only a few will send you an e-mail asking where they should subscribe at.<br>\r\nImagine what will happen when they can’t find an e-mail either, huh? So mind it.</p>\r\n<p><strong>7. Sitemap</strong></p>\r\n<p>Another useful option of your website is a sitemap which usually is of two types. One is for search engines and the other is for the very visitors.<br>\r\nA website map itself is a list of links leading to all the pages your website contains. So by clicking the necessary link each of the visitors may quickly get at necessary section of your online presence and enjoy his or her stay.</p>\r\n<p><strong>8. Web Browsers Compatibility</strong></p>\r\n<p>There is a number of web browsers used by the Internet users. And it is very important for your website to run properly in each of them, whether it is Internet Explorer, Firefox or other browser.<br>\r\nIt will be better for you not to prefer only certain web browsers and avoid others. That will somehow show your respect to the potential clients if you try to make your website compatible with as many web browsers as you can.</p>\r\n<p><strong>9. Images</strong></p>\r\n<p>Building your website you of course paste a lot of images there to make your online presence look nice and eye-catching. So it is very important for all the pictures to be of the proper format – neither too large nor pixelated.<br>\r\n300dpi is considered to be the standard resolution for an image but in case of website creating you should choose lower one. Thus you will make an image file smaller and allow your visitors to download it quickly.<br>\r\nSome image editors has the “Save for webpage” option which helps you to save your picture automatically with a proper size and resolution.</p>\r\n<p><strong>10. Analytics</strong></p>\r\n<p>The last useful point concerns the very owners of the websites. Statistics and analytics function helps them to see how popular their web presence is and what aspects should be improved first of all.<br>\r\nWith the help of statistics you can discover how do people find your website, who links to you, how many hits you have and so on. You will get useful pieces of information from the stats and be a breast of your website’s every aspect!</p>\r\n</div>\r\n</div>','2016-11-04 09:56:24','2016-11-04 10:00:48',1);

/*Table structure for table `cms_block_store` */

DROP TABLE IF EXISTS `cms_block_store`;

CREATE TABLE `cms_block_store` (
  `block_id` smallint(6) NOT NULL COMMENT 'Block ID',
  `store_id` smallint(5) unsigned NOT NULL COMMENT 'Store ID',
  PRIMARY KEY (`block_id`,`store_id`),
  KEY `IDX_CMS_BLOCK_STORE_STORE_ID` (`store_id`),
  CONSTRAINT `FK_CMS_BLOCK_STORE_BLOCK_ID_CMS_BLOCK_BLOCK_ID` FOREIGN KEY (`block_id`) REFERENCES `cms_block` (`block_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_CMS_BLOCK_STORE_STORE_ID_CORE_STORE_STORE_ID` FOREIGN KEY (`store_id`) REFERENCES `core_store` (`store_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='CMS Block To Store Linkage Table';

/*Data for the table `cms_block_store` */

