d is available upon request.</p>\r\n<p><strong>FREE STANDARD SHIPPING</strong><br>Shipping times vary based on a product\'s availability. Method of shipment will depend on the size, weight, and value of your order. We will use US Priority Mail, FedEx Ground, or UPS Ground. Once your order has shipped we will send you an e-mail with the tracking information. Expedited shipping is available in most cases - additional fees apply.</p>\r\n<p><strong>INTERNATIONAL SHIPPING </strong><br>Intuit will ship software overseas but as it is often unreliable, we only offer download licenses for international software purchases. Intuit will not ship hardware overseas. Intuit will ship to reshippers or 3rd Party Shipping companies based in the USA.\r\n<br>\r\n<strong>NOTE:</strong>Intuit will not ship to post office boxes.<br>\r\nPlease note that the QuickBooks Point of Sale software is designed for use with US Dollars only. Also note that if you are using QuickBooks financial software and have multi-currency turned on, MyDigitalPayroll Point of Sale WILL NOT connect or sync with it.</p>\r\n<p><strong>RETURN POLICY</strong>Any products purchased via the MyDigitalPayroll.com Online store can be returned to MyDigitalPayroll.com within 60 days of the order, for a full refund of the purchase, minus all shipping costs. There is no return accepted on computers, monitors, and/or paper supplies. Please reply to your order confirmation email, expressing your intentions or telephone MyDigitalPayroll.com Customer Service at 844-759-2075.</p>\r\n</div>','2016-11-10 08:29:01','2016-11-10 08:34:19',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Disclaimer','one_column',NULL,NULL,'disclaimer','Disclaimer ','<div class=\"disclaimerPage\">\r\n<p><strong>Disclaimer for MyDigitalPayroll</strong></p>\r\n<p>If you require any more information or have any questions about our site\'s disclaimer, please feel free to contact us by email at info@MyDigitalPayroll.com.</p>\r\n<p><strong>Disclaimers for http://www.mydigitalpayroll.com/:</strong><br>\r\nAll the information on this website is published in good faith and for general information purpose only. http://www.MyDigitalPayroll.com/ does not make any warranties about the completeness, reliability and accuracy of this information. Any action you take upon the information you find on this website (http://www.MyDigitalPayroll.com/), is strictly at your own risk. http://www.MyDigitalPayroll.com/ will not be liable for any losses and/or damages in connection with the use of our website.<br>\r\nFrom our website, you can visit other websites by following hyperlinks to such external sites. While we strive to provide only quality links to useful and ethical websites, we have no control over the content and nature of these sites. These links to other websites do not imply a recommendation for all the content found on these sites. Site owners and content may change without notice and may occur before we have the opportunity to remove a link which may have gone \'bad\'.<br>\r\nPlease be also aware that when you leave our website, other sites may have different privacy policies and terms which are beyond our control. Please be sure to check the Privacy Policies of these sites as well as their \"Terms of Service\" before engaging in any business or uploading any information.</p>\r\n<p><strong>Consent </strong><br>\r\nBy using our website, you hereby consent to our disclaimer and agree to its terms.</p>\r\n<p><strong>Update</strong><br>\r\nThis site disclaimer was last updated on: Tuesday, March 29th, 2016<br>\r\n<em>Should we update, amend or make any changes to this document, those changes will be prominently posted here.</em></p>\r\n<p><strong>DISCLAIMER OF WARRANTIES:</strong><br>\r\n<strong>1.</strong>YOUR USE OF THE SOFTWARE AND CONTENT IS ENTIRELY AT YOUR OWN RISK. EXCEPT AS DESCRIBED IN THIS AGREEMENT, THE SOFTWARE IS PROVIDED \"AS IS.\" TO THE MAXIMUM EXTENT PERMITTED BY APPLICABLE LAW, INTUIT, ITS AFFILIATES, AND ITS THIRD PARTY PROVIDERS, LICENSORS, DISTRIBUTORS OR SUPPLIERS (COLLECTIVELY, \"SUPPLIERS\") DISCLAIM ALL WARRANTIES, EXPRESS OR IMPLIED, INCLUDING ANY WARRANTY THAT THE SOFTWARE IS FIT FOR A PARTICULAR PURPOSE, TITLE, MERCHANTABILITY, DATA LOSS, NON-INTERFERENCE WITH OR NON-INFRINGEMENT OF ANY INTELLECTUAL PROPERTY RIGHTS, OR THE ACCURACY, RELIABILITY, QUALITY OR CONTENT IN OR LINKED TO THE SOFTWARE. INTUIT AND ITS AFFILIATES AND SUPPLIERS DO NOT WARRANT THAT THE SOFTWARE IS SECURE, FREE FROM BUGS, VIRUSES, INTERRUPTION, ERRORS, THEFT OR DESTRUCTION. IF THE EXCLUSIONS FOR IMPLIED WARRANTIES DO NOT APPLY TO YOU, ANY IMPLIED WARRANTIES ARE LIMITED TO 60 DAYS FROM THE DATE OF PURCHASE OR DELIVERY OF THE SERVICES, WHICHEVER IS SOONER.</p>\r\n<p><strong>2.</strong>INTUIT, ITS AFFILIATES AND SUPPLIERS DISCLAIM ANY REPRESENTATIONS OR WARRANTIES THAT YOUR USE OF THE SOFTWARE WILL SATISFY OR ENSURE COMPLIANCE WITH ANY LEGAL OBLIGATIONS OR LAWS OR REGULATIONS.</p>\r\n</div>\r\n\r\n','2016-11-10 08:35:25','2016-11-10 08:35:25',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Privacy Policy','one_column',NULL,NULL,'privacy-policy','Privacy Policy','<div class=\"privacyPolicyPage\">\r\n<p>Privacy Policy This privacy policy has been compiled to better serve those who are concerned with how their \'Personally identifiable information\' (PII) is being used online. PII, as used in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context.</p>\r\n<p>Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website. What personal information do we collect from the people that visit our blog, website or app? When ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, mailing address, phone number, credit card information or other details to help you with your experience.</p>\r\n<p>When do we collect information? We collect information from you when you place an order, subscribe to a newsletter, fill out a form or enter information on our site. How do we use your information? We may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways: • To improve our website in order to better serve you.</p>\r\n<p>To allow us to better service you in responding to your customer service requests.</p>\r\n<p>To quickly process your transactions.</p>\r\n<p>To send periodic emails regarding your order or other products and services.</p>\r\n<p>How do we protect visitor information? Our website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.</p>\r\n<p>We use regular Malware Scanning. Your personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information you supply is encrypted via Secure Socket Layer (SSL) technology.</p>\r\n<p>We implement a variety of security measures when a user places an order enters, submits, or accesses their information to maintain the safety of your personal information. All transactions are processed through a gateway provider and are not stored or processed on our servers. Do we use \'cookies\'? Yes.</p>\r\n<p>Cookies are small files that a site or its service provider transfers to your computer\'s hard drive through your Web browser (if you allow) that enables the site\'s or service provider\'s systems to recognize your browser and capture and remember certain information.</p>\r\n<p>For instance, we use cookies to help us remember and process the items in your shopping cart. They are also used to help us understand your preferences based on previous or current site activity, which enables us to provide you with improved services. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.</p>\r\n<p>We use cookies to:</p>\r\n<ul>\r\n<li>Help remember and process the items in the shopping cart.</li>\r\n<li>Understand and save user\'s preferences for future visits.</li>\r\n</ul>\r\n<p>You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer) settings. Each browser is a little different, so look at your browser\'s Help menu to learn the correct way to modify your cookies.</p>\r\n<p>If you disable cookies off, some features will be disabled It won\'t affect the users experience that make your site experience more efficient and some of our services will not function properly. However, you can still place orders . Third Party Disclosure We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information unless we provide you with advance notice. This does not include website hosting partners and other parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others\' rights, property, or safety.</p>\r\n<p>However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses. Third party links We do not include or offer third party products or services on our website. Google Google\'s advertising requirements can be summed up by Google\'s Advertising Principles. They are put in place to provide a positive experience for users.</p>\r\n<p>https://support.google.com/adwordspolicy/answer/1316548?hl=en We use Google AdSense Advertising on our website. Google, as a third party vendor, uses cookies to serve ads on our site. Google\'s use of the DART cookie enables it to serve ads to our users based on their visit to our site and other sites on the Internet. Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy. We have implemented the following: \r\nRemarketing with Google AdSense We along with third-party vendors, such as Google use first-party cookies (such as the Google Analytics cookies) and third-party cookies (such as the DoubleClick cookie) or other third-party identifiers together to compile data regarding user interactions with ad impressions, and other ad service functions as they relate to our website. Opting out: Users can set preferences for how Google advertises to you using the Google Ad Settings page. Alternatively, you can opt out by visiting the Network Advertising initiative opt out page or permanently using the Google Analytics Opt Out Browser add on. California Online Privacy Protection Act CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy.</p>\r\n<p>The law\'s reach stretches well beyond California to require a person or company in the United States (and conceivably the world) that operates websites collecting personally identifiable information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals with whom it is being shared, and to comply with this policy. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf According to CalOPPA we agree to the following: Users can visit our site anonymously Once this privacy policy is created, we will add a link to it on our home page, or as a minimum on the first significant page after entering our website. Our Privacy Policy link includes the word \'Privacy\', and can be easily be found on the page specified above.<br>\r\nUsers will be notified of any privacy policy changes.</p>\r\n<p>On our Privacy Policy Page Users are able to change their personal information:</p>\r\n<ul>\r\n<li>By emailing us</li>\r\n<li>By logging in to their account How does our site handle do not track signals? We honor do not track signals and do not track, plant cookies, or use advertising when a Do Not Track (DNT) browser mechanism is in place. Does our site allow third party behavioral tracking? It\'s also important to note that we do not allow third party behavioral tracking COPPA (Children Online Privacy Protection Act) When it comes to the collection of personal information from children under 13, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, the nation\'s consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online. We do not specifically market to children under 13. Fair Information Practices The Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information. In order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur: We will notify the users via email Within 7 business days We also agree to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users, but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors. CAN SPAM Act The CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.</li>\r\n</ul>\r\n<p>We collect your email address in order to:</p>\r\n<ul>\r\n<li>Send information, respond to inquiries, and/or other requests or questions.</li>\r\n<li>Process orders and to send information and updates pertaining to orders</li>\r\n<li>We may also send you additional information related to your product and/or service.</li>\r\n<li>Market to our mailing list or continue to send emails to our clients after the original transaction has occurred To be in accordance with CANSPAM we agree to the following: • NOT use false, or misleading subjects or email addresses</li>\r\n<li>Identify the message as an advertisement in some reasonable way</li>\r\n<li>Include the physical address of our business or site headquarters Monitor third party email marketing services for compliance, if one is used.</li>\r\n<li>Honor opt-out/unsubscribe requests quickly</li>\r\n<li>Allow users to unsubscribe by using the link at the bottom of each email If at any time you would like to unsubscribe from receiving future emails, you can email us at</li>\r\n<li>Follow the instructions at the bottom of each email. and we will promptly remove you from ALL correspondence. Contact Us If there are any questions regarding this privacy policy you may contact us using the information below. mydigitalpayroll.com info@mydigitalpayroll.com 844-759-2075 Last Edited on 2016-01-26</li>\r\n</ul>\r\n</div>','2016-11-10 08:37:45','2016-11-10 08:38:44',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Terms & Conditions','one_column',NULL,NULL,'terms-conditions','Terms & Conditions','<div class=\"termsConPage\">\r\n<p>PLEASE READ THE FOLLOWING TERMS AND CONDITIONS CAREFULLY. THEY CONTAIN IMPORTANT INFORMATION ABOUT YOUR RIGHTS AND OBLIGATIONS, AS WELL AS LIMITATIONS AND EXCLUSIONS THAT APPLY TO YOUR PURCHASES.</p>\r\n<p><strong>TERMS AND CONDITIONS </strong><br>\r\nThe following terms and conditions govern your use of this Site and the purchase of products by you through this Site. By using this Site, placing an order with us, you are indicating your acceptance of the following terms and conditions (the \"Terms and Conditions\"). The Terms and Conditions shall supplement any subsequent terms or conditions included with any purchase order, whether or not such terms or conditions are signed by us. We reserve the right to make changes to this Site and these Terms and Conditions at any time.</p>\r\n<p><strong>ORDER ACCEPTANCE POLICY </strong><br>\r\nPayment shall be made through PayPal account, by credit card online, or over the phone. Your receipt of an electronic or other form of order confirmation does not signify our acceptance of your order, nor does it constitute confirmation of the order or our offer to sell. We reserve the right, without prior notification, to accept or decline your order or limit the order quantity for any reason. For credit card payments, such payment is subject to the approval of the financial institution issuing the credit card and we shall not be liable in any way if such financial institution refuses to accept or honor the credit card for any reason. We may require, at our option, that any order placed over certain dollar amounts receive our pre-approval. We also may require additional verification or information before accepting any order.</p>\r\n<p><strong>TYPOGRAPHICAL ERRORS </strong><br>\r\nIn the event a product is listed at an incorrect price or with incorrect information due to typographical error or error in pricing or product information, we shall have the right to refuse or cancel any orders placed for products listed at the incorrect price. We shall have the right to refuse or cancel any such orders whether or not the order has been confirmed and your credit card has been charged. If your credit card has already been charged for the purchase and your order is cancelled, we shall immediately issue a credit to your credit card account in the amount of the charge.</p>\r\n<p><strong>PRODUCT AVAILABILITY</strong><br>\r\nWe cannot guarantee product availability and products, nonetheless, these items may not be available for immediate delivery. We reserve the right, without liability or prior notice, to revise, discontinue, or cease to make available any or all products or to cancel any order. If there is any revision, discontinuance, or cessation, we may, in our discretion, ship products which have substantially similar functionality and specifications to the products ordered or cancel your order.</p>\r\n</div>','2016-11-10 08:45:51','2016-11-10 08:45:51',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(12,'About Us','one_column',NULL,NULL,'about-us','About Us','<div class=\"col3-set aboutUsPage\">\r\n<div class=\"col-1\">\r\n<p>We are Intuit Authorized products reseller headquartered at Denver, CO and branching out our name steadfastly to locations spanning across the world frontiers. Embarking on our journey as Merchants of QuickBooks, we take pride in providing customers with fantastic Intuit product line-up and shopping gratification.</p>\r\n<p>As our name suggests, we are the ace professionals engaged in trading Intuit software and QuickBooks Point of Sale devices and set a platform for customers to explore a wide range of payroll products which once bought, let customers pay smartly to their employees.</p>\r\n<p>The products include QuickBooks Enterprise, QuickBooks Online Essentials, QuickBooks Pro, and Quicken Home &amp; Business, to name a few. To help ring up your sales fast and manage your inventory inside out, we supply QuickBooks Point of Sale hardware peripherals like QuickBooks POS MSR and QuickBooks POS barcode Scanner and many more.</p>\r\n<p>With our decision to back those befuddled customers who are constantly in need of advising support, we have also forayed into QuickBooks and tax planning consultancy. Resolve your issues quickly by asking queries to our highly dedicated experts standing by and with unlimited chat and phone support, get help when you need it.</p>\r\n<p>What differentiates us from rest of the others is our proven track record of selling products at 100% conversion rate that firmly resonates with our deeply ingrained commitment to offer only the bestsellers. In addition, our consultancy solution matches the industry specific standards of the highest order which has only been made possible by our resolute and highly dedicated pool of consulting experts.</p>\r\n</div>\r\n</div>','2016-11-10 08:47:53','2016-11-10 08:47:53',1,0,NULL,NULL,NULL,NULL,NULL,NULL);

/*Table structure for table `cms_page_store` */

DROP TABLE IF EXISTS `cms_page_store`;

CREATE TABLE `cms_page_store` (
  `page_id` smallint(6) NOT NULL COMMENT 'Page ID',
  `store_id` smallint(5) unsigned NOT NULL COMMENT 'Store ID',
  PRIMARY KEY (`page_id`,`store_id`),
  KEY `IDX_CMS_PAGE_STORE_STORE_ID` (`store_id`),
